DROP TABLE Toate_liceele;
/
CREATE TABLE Toate_liceele (
  Id INTEGER,
  Nume VARCHAR2(100),
  Tara VARCHAR2(100),
  Judet_Sector VARCHAR2(100),
  Localitate VARCHAR2(100),
  CONSTRAINT Toate_liceele_pk PRIMARY KEY (Id)
);
/
DROP SEQUENCE auto_inc_seq_licee;
/
CREATE SEQUENCE auto_inc_seq_licee START WITH 1;
/
DROP TRIGGER auto_inc_licee;
/
CREATE OR REPLACE TRIGGER auto_inc_licee
BEFORE INSERT ON Toate_liceele FOR EACH ROW
BEGIN
  SELECT auto_inc_seq_licee.NEXTVAL
  INTO   :NEW.id
  FROM   DUAL;
END;
